import React from 'react';
import { connect } from 'react-redux';
import moment from 'moment'

import { makeStyles } from '@material-ui/core/styles';
import Paper from '@material-ui/core/Paper';
import Table from '@material-ui/core/Table';
import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import TableContainer from '@material-ui/core/TableContainer';
import TableHead from '@material-ui/core/TableHead';
import TablePagination from '@material-ui/core/TablePagination';
import TableRow from '@material-ui/core/TableRow';

const columns = [
    { id: 'name', label: 'Chinese auction Name', minWidth: 170 },
    {
        id: 'start_date',
        label: 'Start Date',
        minWidth: 170,
        align: 'right',
        //format: (value) => moment(value).format('D/MM/YYYY')
    },
    {
        id: 'end_date',
        label: 'End date',
        minWidth: 170,
        align: 'right',
     //   format: (value) => moment(value).format('D/MM/YYYY')
    },
    {
        id: 'done',
        label: 'Done',
        minWidth: 170,
        align: 'right',
        format: (value) => value.toFixed(2),
    },
    {
        id: 'options',
        label: 'Options',
        minWidth: 170,
        align: 'right',
        format: (value) => value.toFixed(2),
    }
];

function createData(name, start_date, end_date, done) {
    const options = "to add buttons"
    return { name, start_date, end_date, done, options };
}

const rows = [
    // TODO: sort by date
    createData('לזכות ברגע',/* new Date(2021, 7, 1)*/5, new Date(2021, 9, 1), 'false'),
    //createData('הרבה נחת', new Date(2021, 8, 1), new Date(2021, 10, 1), 'false'),
    //createData('ועל גמילות חסדים', new Date(2020, 10, 1), new Date(2020, 12, 1), 'true')
];

const useStyles = makeStyles({
    root: {
        width: '60%',
    },
    container: {
        maxHeight: 440,
    },
});

const AuctionManagerTable = () => {
    const classes = useStyles();
    const [page, setPage] = React.useState(0);
    const [rowsPerPage, setRowsPerPage] = React.useState(10);

    const handleChangePage = (event, newPage) => {
        setPage(newPage);
    };

    const handleChangeRowsPerPage = (event) => {
        setRowsPerPage(+event.target.value);
        setPage(0);
    };

    return (
        <center>
            <h1>Chinese Auction Manager</h1>
            <Paper className={classes.root}>
                <TableContainer className={classes.container}>
                    <Table stickyHeader aria-label="sticky table">
                        <TableHead>
                            <TableRow>
                                {columns.map((column) => (
                                    <TableCell
                                        key={column.id}
                                        align={column.align}
                                        style={{ minWidth: column.minWidth }}
                                    >
                                        {column.label}
                                    </TableCell>
                                ))}
                            </TableRow>
                        </TableHead>
                        <TableBody>
                            {rows.slice(page * rowsPerPage, page * rowsPerPage + rowsPerPage).map((row) => {
                                return (
                                    <TableRow hover role="checkbox" tabIndex={-1} key={row.code}>
                                        {columns.map((column) => {
                                            const value = row[column.id];
                                            return (
                                                <TableCell key={column.id} align={column.align}>
                                                    {column.format && typeof value === 'number' ? column.format(value) : value}
                                                </TableCell>
                                            );
                                        })}
                                    </TableRow>
                                );
                            })}
                        </TableBody>
                    </Table>
                </TableContainer>
                <TablePagination
                    rowsPerPageOptions={[5, 10, 25]}
                    component="div"
                    count={rows.length}
                    rowsPerPage={rowsPerPage}
                    page={page}
                    onPageChange={handleChangePage}
                    onRowsPerPageChange={handleChangeRowsPerPage}
                />
            </Paper>
        </center>);
}
const mapStateToProps = (state) => {
    return {

    };
}
export default connect(mapStateToProps, {})(AuctionManagerTable);
